import React from "react";

// Shorter version of the initial code
const Weather = (props) => {
    return (
        <div>
            {props.city &&
            <div>
            <p>Location: {props.city}, {props.country}</p>
            <p>Temprature: {props.temp}</p>
            <p>Pressure: {props.pressure}</p>
            <p>Sunset: {props.sunset}</p>
            < /div>
            }
            <p>{props.error}</p>
            </div>
        );
}

export default Weather;

